import React from 'react'

export const Header = (props) => {
    function searchHero(event){
        props.setSearch((event)=>event.target.value)
    }
    return (
       <header>
           <label htmlFor=''>
               Buscar Heroi:
               <input type='text' value={props.search} onChange={()=>searchHero(event)} />

           </label>
       </header>
    )
}
